import {Container, Paper} from "@mui/material";

export default function Myskills(){
    const techStyle = {width:"100%", margin:"0 auto", padding:"0 auto"}
    return (
        <Container>
            <Paper elevation={3} style={techStyle}>
                <h2>My Skills</h2>
            </Paper>
        </Container>
    )
}
